import React, { useState, useEffect, useRef } from "react";
import "tailwindcss/tailwind.css";
import github from "./icons/github.png";
import behance from "./icons/behance.png";
import gmail from "./icons/gmail.png";
import linkedin from "./icons/linkedin.png";
import medium from "./icons/medium.png";

function Terminal() {
  const [command, setCommand] = useState("");
  const [output, setOutput] = useState([]);
  const [welcomeMessage, setWelcomeMessage] = useState(
    "Welcome to my portfolio! To start exploring this Terminal type <i>help</i> then press enter. Note that the Tab Key helps you complete the commands."
  );

  const terminalRef = useRef(null);

  useEffect(() => {
    terminalRef.current.scrollTop = terminalRef.current.scrollHeight;
  }, [output]);

  function handleCommand(e) {
    e.preventDefault();
    let newOutput = [...output, { command: command, output: "" }];
    switch (command.toLowerCase()) {
      case "about":
        newOutput[newOutput.length - 1].output = `My name is Fatima STAILI, I am a cybersecurity student who has had a long-standing passion for technology and security and a slight web development background, I am currently working on networking certifications. I am a bachelor student in cyber security and a member of the development department of the GDG club, based in Orleans.`;
        break;
      case "work":
        newOutput[newOutput.length - 1].output = (
          <>
            <table className="table-auto">
              <thead>
                <tr>
                  <th className="px-4 py-2">Date</th>
                  <th className="px-4 py-2">Entreprise</th>
                  <th className="px-4 py-2">Role</th>
                  <th className="px-4 py-2">Description</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2">Digital Mediator</td>
                  <td className="border px-4 py-2"></td>
                </tr>
                <tr>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2">Assistant Chief Information Security Officer (CISO)</td>
                  <td className="border px-4 py-2"></td>
                </tr>
                <tr>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2">Assistant System and Network Administrator</td>
                  <td className="border px-4 py-2"></td>
                </tr>
                <tr>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2"></td>
                  <td className="border px-4 py-2">Network Technician</td>
                  <td className="border px-4 py-2"></td>
                </tr>
              </tbody>
            </table>
          </>
        );
        break;
      case "contact":
        newOutput[newOutput.length - 1].output = (
          <>
            <img src={gmail} alt="Mail Icon" width="24" height="24" />
            <img src={linkedin} alt="LinkedIn Icon" width="24" height="24" />
            <img src={medium} alt="Medium Icon" width="24" height="24" />
            <img src={github} alt="Github Icon" width="24" height="24" />
            <img src={behance} alt="Behance Icon" width="24" height="24" />
          </>
        );
        break;
      case "skills":
        newOutput[newOutput.length - 1].output = (
          <>
            <p>Cybersecurity</p>
            <p>Computer Networks</p>
            <p>HTML, CSS, JavaScript</p>
            <p>ReactJS</p>
            <p>Python</p>
          </>
        );
        break;
      case "help":
        newOutput[newOutput.length - 1].output =
          "Commands: about, work, skills, contact";
        break;
      default:
        newOutput[newOutput.length - 1].output = `${command} command not found, type help for more informations`;
        break;
    }
    setOutput(newOutput);
    setCommand("");
  }

  function handleChange(e) {
    setCommand(e.target.value);
  }

  function handleKeyDown(e) {
    if (e.key === "Tab") {
      e.preventDefault();
      switch (command) {
        case "ab":
          setCommand("about");
          break;
        case "wo":
          setCommand("work");
          break;
        case "co":
          setCommand("contact");
          break;
        case "sk":
          setCommand("skills");
          break;
        case "h":
          setCommand("help");
          break;
        default:
          break;
      }
    }
  }

  return (
    <div className="h-screen w-screen bg-black flex justify-center items-center">
      <div className="bg-gray-900 text-white text-left flex flex-col rounded-lg w-2/3 h-3/4 overflow-hidden">
        <div className="bg-gray-700 p-2 rounded-t-lg flex items-center justify-between">
          <h1 className="text-3xl font-bold">Terminal</h1>
          <div>
            <button className="text-red-500 text-3xl font-bold mx-1">
              X
            </button>
          </div>
        </div>
        <div className="flex-grow bg-gray-800 p-4 overflow-auto break-words" ref={terminalRef}>
          <div
            className="mb-6 text-center"
            dangerouslySetInnerHTML={{ __html: welcomeMessage }}
          ></div>
          {output.map((item, index) => (
            <div key={index}>
              <div className="mt-2 text-blue-500 font-mono">
                visitor@terminal.staili : ~$ {item.command}
              </div>
              <div className="mt-2">
                <pre>{item.output}</pre>
              </div>
            </div>
          ))}
          <form onSubmit={handleCommand} className="flex">
            <div className="mr-2 text-blue-500 font-mono self-end">
              visitor@terminal.staili : ~$
            </div>
            <input
              type="text"
              value={command}
              onChange={handleChange}
              onKeyDown={handleKeyDown}
              className="flex-grow bg-transparent text-green-300 focus:outline-none border-b-2 border-green-300 font-mono"
            />
          </form>
        </div>
      </div>
    </div>
  );
}

export default Terminal;
